			<div style="text-align: left;">Atendendo a solicitação da <b>APROFEM</b>, o sr. Secretário Municipal de Educação Gabriel Chalita atendeu em audiência, no dia 26 de janeiro, o presidente da Entidade.</div><div style="text-align: left;"><br></div><div style="text-align: left;">Na proveitosa reunião, o representante da <b>APROFEM</b> tratou de inúmeros assuntos de interesse da categoria, dentre eles:</div><div style="text-align: left;"><br></div><div><ul><li style="text-align: left;"><span style="line-height: 1.2;">entrega formal da Pauta Geral de Reivindicações da APROFEM, onde estão listadas as reivindicações para todo o funcionalismo municipal (mais amplas e abrangentes), para todo o Quadro dos Profissionais de Educação, para o Quadro do Magistério, para o Quadro de Apoio à Educação, para os servidores do Nível Básico, para os servidores do Nível Médio, para os servidores do Nível Superior, para os Profissionais da Saúde, para Aposentados e Pensionistas, para Profissionais em Situação de Readaptação Funcional para comissionados, admitidos, e contratados, DESS e HSPM (Hospital do Servidor Público Municipal) (a Pauta Geral de Reivindicações pode ser acessada através do Portal</span><b style="line-height: 1.2;"> APROFEM</b><span style="line-height: 1.2;"> - </span>portal.aprofem.happybiz.com.br<span style="line-height: 1.2;">);</span></li></ul></div><div><ul><li style="text-align: left;"><span style="line-height: 1.2;">solicitação de retomada das reuniões da Mesa Setorial de Negociação - Educação (prontamente aceita e assegurada pelo Secretário), priorizando os temas pactuados no bojo do Protocolo de Negociação firmado em 2014: saúde do educador, segurança nas escolas, condições de trabalho, direitos funcionais e demais aspectos relacionados com o cotidiano da desejada ação educativa de qualidade (módulos, concursos, unidades polo na Educação Infantil, modulação na implantação do Sistema de Gestão Pedagógica, Quadro de Apoio à Educação, ...);</span></li></ul></div><div><ul><li style="text-align: left;"><span style="line-height: 1.2;">negociação dos pisos salariais para 2015, na data-base (maio), na Mesa Central de Negociação;</span><br></li></ul></div><div><ul><li style="text-align: left;"><span style="line-height: 1.2;">revisão da lei das 2 referências (Quadro do Magistério), agilizando enquadramentos e ampliando o universo de servidores ativos beneficiados, ao flexibilizar critérios; assegurando o enquadramento automático dos aposentados e pensionistas.</span><br></li></ul></div><div style="text-align: left;"><br></div><div style="text-align: left;">O sr. Secretário reiterou as suas declarações de disposição para o diálogo franco e direto com os educadores, com os alunos e com os pais/responsáveis, em momentos separados, no âmbito de cada DRE; ressaltou a importância do trabalho dos gestores educacionais, com ênfase na atuação do Diretor de Escola, líder natural do processo; convidou a Entidade para uma atuação compartilhada, crítica e responsável.</div><div style="text-align: left;"><br></div><div style="text-align: left;"><b>OPINIÃO DA APROFEM:</b> Conhecedores, de longa data, da bagagem profissional do atual Secretário, inclusive pela condição de conferencista em eventos da<b> APROFEM </b>em diversas oportunidades, a impressão advinda dessa primeira audiência, somada às suas declarações (juntamente com as do prefeito Haddad) no ato da sua posse e no evento posterior (dia 26/01) em que alguns gestores educacionais foram homenageados, é de expectativa e esperança em uma gestão que valorize e respeite os Profissionais de Educação municipais. Para isso, bastará que uma fração dos depoimentos confessos de reconhecimento do trabalho dos educadores se traduza em ações efetivas para a valorização dos mesmos. E a APROFEM estará presente, atuando e cobrando a sua concretização.</div><div style="text-align: left;"><br></div><div style="text-align: center;"><img src="data:image/jpeg;base64,
